con:config.script:
//Declare TestCase object
def testcase = testRunner.testCase

//Get label of TestCase and print it
def testCaseTitle = testcase.getLabel()
log.info testCaseTitle

//Declare TestSuite object
def testsuite = testcase.testSuite
log.info testsuite.getLabel()

//Declare Project object
def project = testsuite.project
log.info project.getName()

//Controlling flow of TestSteps
for(i in 1..10)
{
	a = Math.random()*10
    if(a < 5.0) {
        testRunner.runTestStepByName("Add")
        log.info (i + "_Add run : " + a)
    } else {
        testRunner.runTestStepByName("Subtract")
        log.info (i + "_Sub run : " + a)
    }
}
